import jsPDF from 'jspdf';

const pdfdata = data => {
  const docdata = {
    Contact_and_Awareness: [],
    Understanding: [],
    Expectations: [],
    Reinforcement: [],
    Adoptation: []
  };
  for (let index = 0; index < data.length; index++) {
    if (data[index].SectionHeader === 'Contact_and_Awareness') {
      docdata.Contact_and_Awareness.push(data[index]);
    } else if (data[index].SectionHeader === 'Understanding') {
      docdata.Understanding.push(data[index]);
    } else if (data[index].SectionHeader === 'Expectations') {
      docdata.Expectations.push(data[index]);
    } else if (data[index].SectionHeader === 'Reinforcement') {
      docdata.Reinforcement.push(data[index]);
    } else if (data[index].SectionHeader === 'Adoption') {
      docdata.Adoptation.push(data[index]);
    }
  }
  docdata.Contact_and_Awareness = fnSortDate(docdata.Contact_and_Awareness);
  docdata.Understanding = fnSortDate(docdata.Understanding);
  docdata.Expectations = fnSortDate(docdata.Expectations);
  docdata.Reinforcement = fnSortDate(docdata.Reinforcement);
  docdata.Adoptation = fnSortDate(docdata.Adoptation);
  return docdata;
};

const fnSortDate = aValue => {
  var lst1 = [];
  var lst2 = [];
  var lst3 = [];
  aValue.forEach(element => {
    if (element.Intent === 'Adaptive') {
      lst1.push(element);
    } else {
      lst2.push(element);
    }
  });
  lst1 = fnSort(lst1);
  lst2 = fnSort(lst2);
  lst3 = lst1.concat(lst2);
  return lst3;
};

const fnSort = aValue => {
  aValue.sort(function compare(a, b) {
    var comparison = 0;
    if (a.date > b.date) {
      comparison = 1;
    } else if (a.date < b.date) {
      comparison = -1;
    }
    return comparison;
  });
  return aValue;
};

export const generateChangeJourneyPDF = (employeeType, ReleaseCategory, data) => {
  const oCalData = pdfdata(data);

  var doc = new jsPDF();
  const images = images1();
  var imgData = images.Pic1;
  doc.addImage(imgData, 'png', 0, 0, 220, 20);
  var sValue = employeeType + ' Journey ';
  doc.setTextColor(255, 255, 255);
  doc.setFontType('bolditalic');
  doc.addImage(cgIcon, 'JPEG', 0, 280, 110, 50);
  doc.setFontSize(25);
  doc.text(7, 12, sValue);
  doc.setTextColor(0, 0, 0);
  doc.setFontType('normal');

  var contactEndAxis = 0;
  var understandingEndAxis = 0;
  var expectationEndAxis = 0;
  var reinforcementEndAxis = 0;
  var AdoptationEndAxis = 0;

  var startAxis = 0;
  var endAxis = 0;

  var xaxis, z;
  var iYaxis = 40;
  for (var j = 0; j <= 4; j++) {
    doc.setFontSize(16);
    doc.setTextColor(0, 0, 0);

    if (j === 0) {
      startAxis = iYaxis;
      z = oCalData.Contact_and_Awareness;
      xaxis = 15;
      imgData = images.Pic2;
      doc.addImage(imgData, 'png', 1, iYaxis, 110, 20);
      doc.text(10, iYaxis + 6, 'Contact and Awareness');
    } else if (j === 1) {
      var diff = endAxis - startAxis;
      if (diff >= 40) {
        iYaxis = (startAxis + endAxis) / 2;
        if (iYaxis <= startAxis) {
          iYaxis = endAxis + 20;
        }
      } else {
        iYaxis = iYaxis + 20;
      }

      startAxis = iYaxis;
      z = oCalData.Understanding;
      xaxis = 120;
      doc.setDrawColor(173, 216, 230);
      doc.line(100, iYaxis, 100, 60);
      var kaxis = iYaxis;
      imgData = images.Pic3;
      doc.addImage(imgData, 'png', 87, iYaxis, 118, 20);
      doc.text(130, iYaxis + 6, 'Understanding');
    } else if (j === 2) {
      var diff = endAxis - startAxis;
      if (diff >= 40) {
        iYaxis = (startAxis + endAxis) / 2;
        if (iYaxis <= startAxis) {
          iYaxis = endAxis + 20;
        }
      }
      if (iYaxis <= contactEndAxis) {
        iYaxis = contactEndAxis + 5;
      } else {
        iYaxis = iYaxis + 20;
      }

      startAxis = iYaxis;
      z = oCalData.Expectations;
      xaxis = 15;
      doc.line(100, iYaxis, 100, kaxis + 20);
      imgData = images.Pic4;
      doc.addImage(imgData, 'png', 1, iYaxis, 110, 20);
      doc.text(10, iYaxis + 6, 'Expectations');
      kaxis = iYaxis + 20;
    } else if (j === 3) {
      var diff = endAxis - startAxis;
      if (diff >= 40) {
        iYaxis = (startAxis + endAxis) / 2;
        if (iYaxis <= startAxis) {
          iYaxis = endAxis + 20;
        }
      }
      if (iYaxis <= understandingEndAxis) {
        iYaxis = understandingEndAxis + 5;
      } else {
        iYaxis = iYaxis + 20;
      }
      startAxis = iYaxis;
      z = oCalData.Reinforcement;
      xaxis = 120;
      doc.line(100, iYaxis, 100, kaxis);
      imgData = images.Pic5;
      doc.addImage(imgData, 'png', 87, iYaxis, 118, 20);
      doc.line(100, iYaxis, 100, kaxis);
      doc.text(130, iYaxis + 6, 'Reinforcement');
      kaxis = iYaxis + 20;
    } else {
      var diff = endAxis - startAxis;
      if (diff >= 40) {
        iYaxis = (startAxis + endAxis) / 2;
        if (iYaxis <= startAxis) {
          iYaxis = endAxis + 20;
        }
      }
      if (iYaxis <= expectationEndAxis) {
        iYaxis = expectationEndAxis + 5;
      } else {
        iYaxis = iYaxis + 20;
      }

      startAxis = iYaxis;
      z = oCalData.Adoptation;
      xaxis = 15;
      doc.line(100, iYaxis, 100, kaxis);
      imgData = images.Pic6;
      doc.addImage(imgData, 'png', 1, iYaxis, 110, 20);
      doc.text(10, iYaxis + 6, 'Adoption');
    }
    doc.setFontSize(12);
    iYaxis = iYaxis + 15;
    for (var i = 0; i < z.length; i++) {
      iYaxis = iYaxis + 4;
      var textValue = i + 1 + '.  ' + z[i].name;
      if (iYaxis >= 270) {
        iYaxis = 10;
        doc.addPage();
        contactEndAxis = 0;
        understandingEndAxis = 0;
        expectationEndAxis = 0;
        reinforcementEndAxis = 0;
        AdoptationEndAxis = 0;
      }

      if (z[i].Intent === 'Adaptive') {
        doc.setTextColor(0, 0, 0);
      } else {
        doc.setTextColor(255, 99, 71);
      }
      doc.text(xaxis, iYaxis, textValue);
    }
    if (j === 0) {
      contactEndAxis = iYaxis;
    }
    if (j === 1) {
      understandingEndAxis = iYaxis;
    }
    if (j === 2) {
      expectationEndAxis = iYaxis;
    }
    if (j === 3) {
      reinforcementEndAxis = iYaxis;
    }
    if (j === 4) {
      AdoptationEndAxis = iYaxis;
    }
    endAxis = iYaxis;
  }

  doc.save(`Change Journey(${employeeType}__${ReleaseCategory}).pdf`);
};

